func TestMaxOperations(t *testing.T) {
	for i, v := range tests {
		t.Log("test: ", i+1)
		got := longestOnes(v.nums, v.k)
		assert.Equal(t, v.expected, got)
	}
}

func BenchmarkMaxOperations(b *testing.B) {
	funcs := []struct {
		name string
		f    func([]int, int) int
	}{
		{"mine", longestOnes},
		{"leet-fastest", longestOnes_leet47ms},
	}

	var res int
	for _, fun := range funcs {

		b.Run(fun.name, func(b *testing.B) {
			b.ReportAllocs()
			b.ResetTimer()
			for k := 0; k < b.N; k++ {
				res = fun.f(tests[k%len(tests)].nums, tests[k%len(tests)].k)
			}
		})
	}

	result = res
}
